var socket_ioClient = require('socket.io-client');

socket_ioClient.io();
document.getElementById("myFace");
let myStream;

async function getMedia() {
  try {
    myStream = await navigator.mediaDevices.getUserMedia({
      audio: true,
      video: true
    });
    console.log(myStream);
  } catch (e) {
    console.log(e.message);
  }
}

getMedia();
